import Button from "./components/Button";

const App = () => {
  return (
    <Flex
      width="100%"
      justifyContent="center"
      alignItems="center"
      height="100vh"
      flexDirection="column"
    >
      <Image src={jPeriod} width={40} marginBottom={100} color="white" />
      <Box
        width={170}
        alignItems="center"
        justifyContent="space-around"
        display="flex"
        marginBottom={250}
      >
        <Button variant="primary">
          {" "}
          <Text>R</Text>{" "}
        </Button>
        <Image src={instagramIcon} width={40} />
        <Button variant="primary"> L </Button>
      </Box>
    </Flex>
  );
};

export default App;
